import Task from "./Task"; 

class TaskDictionary {

    // Key should be date in the form of a int, day/month/year

    dict = {}; 

    contructor() {}

    static addTask(date, Task) {

        if(dict[date] == null) dict[date] = [Task]; 

        else dict[date].push()


    }


    static sortDict() {
        dict.sort((a, b) => {

            while(a % 100 === b % 100) {
                a /= 100; 
                b /= 100; 

                if(a === 0) break; 
            }

            return a % 100 - b % 100; 
        }); 
    }


}
